import React, { useState, useEffect } from "react";
import { Route, Routes, useLocation } from "react-router-dom";
import Navbar from "./components/View/Navbar";
import Footer from "./components/View/Footer";
import { AuthProvider } from "./context/AuthContext";
import LoadingBar from "react-top-loading-bar";
import "./App.css";
import "./index.css";

// Lazy-loaded components
const Musicians = React.lazy(() => import("./components/View/Musicians"));
const Dashboard = React.lazy(() => import("./components/Dashboard/Dashboard"));
const ArtistDetail = React.lazy(() => import("./components/View/ArtistDetail"));
const Favorites = React.lazy(() => import("./components/View/Favorites"));
const Venues = React.lazy(() => import("./components/View/Venues"));
const VenueDetail = React.lazy(() => import("./components/View/VenueDetail"));
const Unauthorized = React.lazy(() => import("./components/Dashboard/Unauthorized"));
const Jobs = React.lazy(() => import("./components/View/Jobs"));
const About = React.lazy(() => import("./components/View/About"));
const Login = React.lazy(() => import("./components/Dashboard/Login"));
const MusicStore = React.lazy(() => import("./components/View/MusicStore"));
const StoreDetail = React.lazy(() => import("./components/View/StoreDetail"));
const WeddingVIP = React.lazy(() => import("./components/View/WeddingVIP"));
const WeddingVIPDetail = React.lazy(() => import("./components/View/WeddingVipDetail"));
const Comingsoon = React.lazy(() => import("./components/View/ComingSoon"));

const App = () => {
  const location = useLocation();
  const [progress, setProgress] = useState(0);
  const [currentComponent, setCurrentComponent] = useState(<Musicians />); // Start with default component
  const [nextComponent, setNextComponent] = useState(null); // Component being loaded

  // Simulate progress during route changes
  useEffect(() => {
    setProgress(30); // Start loading bar
    const timer = setTimeout(() => setProgress(100), 500); // Complete loading bar in 500ms

    // Load the next route's component
    const loadComponent = async () => {
      switch (location.pathname) {
        case "/":
          setNextComponent(<Musicians />);
          break;
        case "/login":
          setNextComponent(<Login />);
          break;
        case "/db-sarim-shehran1214":
          setNextComponent(<Dashboard />);
          break;
        case "/unauthorized":
          setNextComponent(<Unauthorized />);
          break;
        case "/artist/:id":
          setNextComponent(<ArtistDetail />);
          break;
        case "/favorites":
          setNextComponent(<Favorites />);
          break;
        case "/venues":
          setNextComponent(<Venues />);
          break;
        case "/wedding-vip-packages":
          setNextComponent(<WeddingVIP />);
          break;
        case "/venuedetail/:id":
          setNextComponent(<VenueDetail />);
          break;
        case "/music-store/:id":
          setNextComponent(<StoreDetail />);
          break;
        case "/wedding-vip-packages/:id":
          setNextComponent(<WeddingVIPDetail />);
          break;
        case "/jobs":
          setNextComponent(<Jobs />);
          break;
        case "/about":
          setNextComponent(<About />);
          break;
        case "/music-store":
          setNextComponent(<MusicStore />);
          break;
        case "/comingsoon":
          setNextComponent(<Comingsoon />);
          break;
        default:
          setNextComponent(<Comingsoon />);
      }
    };

    loadComponent();

    // Switch to next component after loading is complete
    const switchTimer = setTimeout(() => {
      if (nextComponent) {
        setCurrentComponent(nextComponent);
        setNextComponent(null); // Reset the next component
      }
    }, 500);

    return () => {
      clearTimeout(timer);
      clearTimeout(switchTimer);
    };
  }, [location]);

  return (
    <AuthProvider>
      <div className="App">
        <LoadingBar
          color="#f11946"
          progress={progress}
          onLoaderFinished={() => setProgress(0)} // Reset after complete
        />

        {/* Navbar */}
        <Navbar />

        {/* Render the current component */}
        {currentComponent}

        {/* Footer */}
        <Footer />
      </div>
    </AuthProvider>
  );
};

export default App;
